import React from 'react';
import Sweet10 from '../images/sweet10.jpg';

function Decoration(){
    return (
        <div className = "decoration">
            <h1 className = "decText">The tradition gets alive at Laddoos, the choice is difficult to make, indulge and intoxicate your senses with every bite.</h1>
            <h1 className = "decText1">There is no after taste, just the lingering memory of having indulged in something undeniably great and of course, the desire for more.</h1>
            <h1 className = "decText2"> A spread that is hand crafted with utmost care. A huge variety to choose from, it will inspire you to explore and taste the divine flavours. You can satisfy your craving for good food at Laddoos.</h1>
            <img src = {Sweet10} width = "100%" height = "100%"/>
        </div>
    );
}

export default Decoration;
